/**
 * 企业发展历程
 */
import React, {Component} from 'react';
import {Timeline} from 'antd';
import {ClockCircleOutlined, DollarCircleOutlined} from '@ant-design/icons';

class Course extends Component {
    render() {
        return (
                <Timeline mode="alternate" pending='奇迹正在诞生......'>
                    <Timeline.Item><b>2021.05.01</b> 飞云在成都市高新区注册成立</Timeline.Item>
                    <Timeline.Item><b>2021.10.01</b> 飞云注册企业突破50家，服务企业用户30000+</Timeline.Item>
                    <Timeline.Item dot={<DollarCircleOutlined style={{fontSize: '16px',color:'#FF881A'}}/>}>
                        <b>2022.02.20</b> 飞云获得A轮融资2000万美元
                    </Timeline.Item>
                    <Timeline.Item><b>2022.04.16</b> 飞云荣获<b>“2021年度十大ERP解决方案”</b>金奖</Timeline.Item>
                    <Timeline.Item><b>2022.07.23</b> 飞云获得B轮融资9000万美元</Timeline.Item>
                    <Timeline.Item dot={<ClockCircleOutlined style={{fontSize: '16px'}}/>}>
                        Technical testing 2015-09-01
                    </Timeline.Item>
                </Timeline>
        );
    }
}

export default Course;
